import React, { useEffect, useState } from "react";

function Content({ response }) {
  let content;

  response
    ? response.ok
      ? (content = <p>could not find character</p>)
      : (content = "something")
    : (content = "there will be content here!!");

  return <p>{content}</p>;
}

export default Content;
